import React from 'react';

const Navbar = () => {
  return (
    <nav className="navbar bg-body-tertiary">
      <div className="container-fluid">
        {/* As a link */}
        {/* <a className="navbar-brand" href="#">Navbar</a> */}
        
        {/* As a heading */}
        <span className="navbar-brand mb-0 h1">Navbar</span>
      </div>
    </nav>
  );
};

export default Navbar;
